import React from 'react'

function MyClubs({ clubData }) {
    return (
        <div className='container-md bg-slate-700'>
            {clubData.map(club => {
                return (
                    <div key={club._id}>
                        <h2>{club.name}</h2>
                        <p>{club.description}</p>
                    </div>
                )
            })}
        </div>
    )
}

export default MyClubs
